// Retrieve PID parameters and state from flow context
let enabled = flow.get("enabled") || false;        // Boolean to enable/disable PID
let setpoint = flow.get("setpoint") || 0;          // Setpoint (target value)
let propBand = flow.get("prop_band") || 1.0;       // Proportional band
let tIntegral = flow.get("t_integral") || 100;     // Integral time (in seconds)
let tDerivative = flow.get("t_derivative") || 25;  // Derivative time (in seconds)
let prevError = context.get("prevError") || 0;     // Previous error
let integral = context.get("integral") || 0;       // Accumulated error
let dt = 1;                                        // Sampling interval (1 second)

// Process incoming messages
switch (msg.topic) {
    case "enable":
        if (typeof msg.payload === "boolean") {
            enabled = msg.payload;
            flow.set("enabled", enabled);
            node.status({ fill: "green", shape: "dot", text: `Enabled: ${enabled}` });
        } else {
            node.error("Invalid payload for 'enable'. Expected a boolean.", msg);
        }
        return null;

    case "setpoint":
        if (typeof msg.payload === "number") {
            setpoint = msg.payload;
            flow.set("setpoint", setpoint);
            node.status({ fill: "blue", shape: "ring", text: `Setpoint: ${setpoint}` });
        } else {
            node.error("Invalid payload for 'setpoint'. Expected a float.", msg);
        }
        return null;

    case "prop_band":
        if (typeof msg.payload === "number") {
            propBand = msg.payload;
            flow.set("prop_band", propBand);
            node.status({ fill: "blue", shape: "ring", text: `Prop Band: ${propBand}` });
        } else {
            node.error("Invalid payload for 'prop_band'. Expected a float.", msg);
        }
        return null;

    case "t_integral":
        if (typeof msg.payload === "number") {
            tIntegral = msg.payload;
            flow.set("t_integral", tIntegral);
            node.status({ fill: "blue", shape: "ring", text: `T Integral: ${tIntegral}` });
        } else {
            node.error("Invalid payload for 't_integral'. Expected a float.", msg);
        }
        return null;

    case "t_derivative":
        if (typeof msg.payload === "number") {
            tDerivative = msg.payload;
            flow.set("t_derivative", tDerivative);
            node.status({ fill: "blue", shape: "ring", text: `T Derivative: ${tDerivative}` });
        } else {
            node.error("Invalid payload for 't_derivative'. Expected a float.", msg);
        }
        return null;

    case "Humidity":
        if (typeof msg.payload === "number") {
            if (!enabled) {
                node.status({ fill: "red", shape: "ring", text: "PID disabled" });
                return null; // PID is disabled, do nothing
            }

            // Calculate PID
            const processValue = msg.payload;
            const error = setpoint - processValue;

            // Proportional term
            const proportional = error / propBand;

            // Integral term
            integral += (error * dt) / tIntegral;

            // Derivative term
            const derivative = tDerivative > 0 ? (error - prevError) / tDerivative : 0;

            // Combine PID terms
            let output = proportional + integral + derivative;

            // Clamp output to range [0, 1]
            output = Math.max(0, Math.min(1, output));

            // Update state
            prevError = error;
            context.set("prevError", prevError);
            context.set("integral", integral);

            // Send output message
            msg.payload = output;
            node.status({ fill: "green", shape: "dot", text: `Output: ${output.toFixed(2)}` });
            return msg;

        } else {
            node.error("Invalid payload for 'Humidity'. Expected a float.", msg);
        }
        return null;

    default:
        node.error(`Unhandled topic: ${msg.topic}`, msg);
        return null;
}
